import React from 'react'
import { connect } from 'react-redux';
import * as actionCreator from "../redux/actions/cityAction"

class MYtinerary extends React.Component {

    componentDidMount() {
        this.props.getCities()
    }
    render() {
        const { cities } = this.props
        console.log(this.props)
        return (
            <div >
                <p>cities</p>
                <button>get cities</button>

            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        cities: state

    }
}
const mapDispatchToProps = (dispatch) => {
    return {
        getCities: () => dispatch(actionCreator.fetchCities())
    }
}
export default connect(mapStateToProps, mapDispatchToProps)(MYtinerary);
